  `user_id` int(11) NOT NULL COMMENT '用户id值',
  `order_id` int(11) NOT NULL COMMENT '订单id值',
  `nick_name` char(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '昵称',
  `head_img` char(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '头像',
  `start_time` int(10) NOT NULL COMMENT '开始时间',
  `end_time` int(10) NOT NULL COMMENT '结束时间',
  `has_price` float(10, 2) NOT NULL COMMENT '已砍价',
  `continue_price` float(10, 2) NOT NULL COMMENT '还要砍的价格',
