) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '用户开砍价表' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for ht_bill
-- ----------------------------
DROP TABLE IF EXISTS `ht_bill`;
CREATE TABLE `ht_bill`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `user_id` int(10) NOT NULL DEFAULT 0 COMMENT '用户id',
  `b_balance` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '发票数额',
