) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for ht_bonus
-- ----------------------------
DROP TABLE IF EXISTS `ht_bonus`;
CREATE TABLE `ht_bonus`  (
  `b_id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` int(11) NOT NULL COMMENT '用户id',
  `price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '金额',
  `type` tinyint(2) NOT NULL COMMENT '1.店铺分享 2.培训费 3.社群销售奖励 4.社群服务费奖励 5.市场拓展',
  `add_time` int(10) NOT NULL COMMENT '增加时间',
