) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '奖金表' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for ht_brand
-- ----------------------------
DROP TABLE IF EXISTS `ht_brand`;
CREATE TABLE `ht_brand`  (
