) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '营业执照挂靠关系表' ROW_FORMAT = Compact;

-- ----------------------------
-- Table structure for ht_card
