-- ----------------------------
-- Table structure for ht_cash
-- ----------------------------
DROP TABLE IF EXISTS `ht_cash`;
CREATE TABLE `ht_cash`  (
  `cash_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '提现id',
