-- ----------------------------
-- Table structure for ht_goods
-- ----------------------------
DROP TABLE IF EXISTS `ht_goods`;
CREATE TABLE `ht_goods`  (
  `goods_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `goods_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `admin_id` int(10) NOT NULL DEFAULT 0 COMMENT '所属用户',
  `category_id` int(10) NOT NULL COMMENT '分类id',
  `price` decimal(10, 2) NOT NULL COMMENT '价格',
  `freight` decimal(10, 2) NOT NULL DEFAULT 0.00,
  `stock` int(10) NOT NULL DEFAULT 0 COMMENT '库存',
  `picture` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '主图',
  `images` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '图片列表',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关键词',
  `introduction` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '简介',
  `description` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '描述',
  `attr_id` int(10) NULL DEFAULT NULL COMMENT '商品类型',
  `spec` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品规格',
  `spec_array` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `volume` int(10) NULL DEFAULT 0 COMMENT '销量',
  `unit` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '单位',
  `recommend` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '推荐位',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '商品状态0上架1下架',
  `create_time` int(10) NULL DEFAULT NULL,
  `update_time` int(10) NULL DEFAULT NULL,
  `weigh` int(10) NOT NULL DEFAULT 0,
  `is_new` tinyint(1) NULL DEFAULT 0 COMMENT '是否为新品',
  `is_hot` tinyint(1) NULL DEFAULT 0 COMMENT '是否热销',
  `is_sale` tinyint(1) NULL DEFAULT 0 COMMENT '是否热销',
  `is_recom` tinyint(1) NULL DEFAULT 0 COMMENT '是否热销',
  `goods_type` tinyint(1) NULL DEFAULT 0 COMMENT '0:实物 1：虚拟商品',
  `exchange_integral` int(10) NULL DEFAULT 0 COMMENT '兑换 积分',
  `sum_sales` int(10) NULL DEFAULT 0 COMMENT '销量',
  `show_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '展示价',
  `commission` tinyint(2) NULL DEFAULT 0 COMMENT '佣金比例',
  `vip_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '会员价',
  `is_free_shipping` tinyint(1) NULL DEFAULT 0 COMMENT '是否包邮',
  `brandid` int(10) NULL DEFAULT 0 COMMENT '品牌id',
  `subject_values` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品主体属性 json字符串',
  `supplier_id` int(10) NULL DEFAULT NULL COMMENT '供应商id',
  `goods_numbers` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品编号',
  `cost_price` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '成本价',
  `prom_type` int(8) NULL DEFAULT 0 COMMENT '1：团购，2:预售，3拼团，4砍价，5秒杀，6满199减100,7:99元3件，8，满2件打9折，9以上自定义活动',
  `prom_id` int(10) NULL DEFAULT 0 COMMENT '促销活动id值',
  `is_recom_today` tinyint(1) NOT NULL DEFAULT 0,
  `cargo_numbers` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '商品货号',
  `active_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '推荐' COMMENT '标签名称',
  `active_state` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标签说明',
  `province` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省列表（偏远地区另外收运费）',
  `basic_freight` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '基本运费',
  `other_freight` float(10, 2) NULL DEFAULT 0.00 COMMENT '偏远地区另外收费',
  `is_gift` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否为大礼包：0，不是',
  `goods_banner` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品banner',
  `is_self` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否是自有商品，0不是1是',
  `is_recommend` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否推荐',
  `is_like` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否推荐为喜欢',
  PRIMARY KEY (`goods_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 3174 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = Compact;

