  `act_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '活动ID',
  `act_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '活动名称',
