  `mp_name` tinyint(1) NULL DEFAULT 1 COMMENT '接收人:1：VIP用户；2：会员店主；3:高级店主；4：旗舰店主；',
  `mp_type` tinyint(1) NULL DEFAULT 0 COMMENT '消息类型：0：图片；1：文字；2：短信；',
  PRIMARY KEY (`mp_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '消息推送表' ROW_FORMAT = Compact;

