-- ----------------------------
-- Table structure for ht_order
-- ----------------------------
DROP TABLE IF EXISTS `ht_order`;
CREATE TABLE `ht_order`  (
  `order_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '订单id',
  `order_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '订单编号',
  `order_uid` int(10) NOT NULL COMMENT '会员id',
  `order_addrid` int(10) NOT NULL COMMENT '收货地址id',
  `order_storeid` int(10) NULL DEFAULT NULL COMMENT '店铺id',
  `order_pay_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付单号',
  `order_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '买家留言',
  `order_all_price` float(10, 2) NULL DEFAULT NULL COMMENT '订单总价',
  `order_pay_price` float(10, 2) NULL DEFAULT NULL COMMENT '订单实际支付总价',
  `order_refund_price` float(10, 2) NULL DEFAULT NULL COMMENT '订单退款金额',
  `order_freight` float(10, 2) NULL DEFAULT NULL COMMENT '订单运费',
  `order_coupon_id` int(10) NULL DEFAULT 0 COMMENT '所用优惠券id',
  `order_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单状态：0，待付款；1，待发货；2，待\r\n\r\n收货；3，待评价；4，已完成；5，已取消；6，申请退货；7，申请换货 8，卖家\r\n\r\n收货；9，卖家退款 10:售后完成',
  `after_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '申请售后状态：1，申请退货；2，申请换货',
  `order_pay_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单支付方式',
  `pay_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '支付状态：0，未支付；1，已付款；2，已取消；3，已部分退款；4，已全部退款',
  `order_isdel` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否删除：0，否；1，是',
  `post_status` tinyint(1) NULL DEFAULT 0 COMMENT '物流状态：0，未配货；1，未发货；2，已发货；3，派送中；4，已收货；3，已退货；4，已换货',
  `post_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流方式',
  `post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `delivery_time` int(10) NULL DEFAULT NULL COMMENT '发货时间',
  `need_invoice` tinyint(1) NULL DEFAULT NULL COMMENT '是否需要发票：0，否；1，是',
  `invoice_header` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发票抬头：1，个人；2，公司',
  `invoice_com` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公司名称',
  `invoice_com_tax` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '税号',
  `order_create_time` int(10) NULL DEFAULT NULL COMMENT '下单时间',
  `order_pay_time` int(10) NULL DEFAULT NULL COMMENT '支付时间',
  `order_finish_time` int(10) NULL DEFAULT NULL COMMENT '完成时间',
  `order_pay_points` float(10, 2) NULL DEFAULT 0.00 COMMENT '积分抵扣金额',
  `order_pay_dedu` float(10, 2) NULL DEFAULT 0.00 COMMENT '购物抵扣积分',
  `invoice_type` tinyint(1) NULL DEFAULT NULL COMMENT '发票类型：1，电子发票；2，纸质发票',
  `order_type` tinyint(1) NULL DEFAULT 0 COMMENT '0: 普通订单 1：积分兑换订单',
  `pro_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省',
  `city_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '市',
  `area` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '区',
  `address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '详细地址',
  `phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收件人手机号',
  `consigee` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '收件人姓名',
  `order_prom_type` tinyint(1) NULL DEFAULT 0 COMMENT '0：普通订单 >0 对应活动id值',
  `order_prom_id` int(11) NULL DEFAULT 0 COMMENT '活动id值',
  `order_prom_amount` float(10, 2) NULL DEFAULT 0.00,
  `order_payed_price` float(10, 2) NULL DEFAULT NULL COMMENT '已支付金额',
  `seller_isdel` tinyint(1) NULL DEFAULT 0 COMMENT '店主是否删除',
  `is_commented` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否已评价：0，未评价',
  `order_discount` float(10, 2) NOT NULL DEFAULT 0.00 COMMENT '订单优惠金额',
  `order_commi_price` float(10, 2) NOT NULL DEFAULT 0.00 COMMENT '订单计算返利的金额',
  `yz_id` int(10) NOT NULL DEFAULT 0 COMMENT '使用元宝id',
  `rc_id` int(10) NOT NULL DEFAULT 0 COMMENT '充值卡id',
  `rc_amount` float(10, 2) NOT NULL DEFAULT 0.00 COMMENT '充值卡金额',
  `giving_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '大礼包赠送人id或者手机号',
  `og_order_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单状态：0，待付款；1，待发\r\n\r\n货；2，待收货；3，待评价；4，已完成；5，已取消；6，申请退货；7，申请换货 \r\n\r\n8，卖家收货；9，卖家退款 ；10,售后完成',
  `pick_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '自提状态：0:不自提 1：自提',
  `is_cash` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否返现,0否 1是',
  `notes` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '订单备注',
  `order_gift` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '满赠',
  `sender_id` int(11) NULL DEFAULT NULL COMMENT '销售员id，',
  `post_id` int(11) NULL DEFAULT NULL COMMENT '配送员id',
  `distance` decimal(10, 2) NULL DEFAULT NULL,
  `stock_id` int(11) NULL DEFAULT NULL,
  PRIMARY KEY (`order_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = Compact;

-- ----------------------------
-- Records of ht_order
-- ----------------------------

-- ----------------------------
-- Table structure for ht_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `ht_order_goods`;
CREATE TABLE `ht_order_goods`  (
  `og_id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `og_order_id` int(10) NOT NULL COMMENT '订单id',
  `og_store_id` int(10) NULL DEFAULT NULL COMMENT '店铺id',
  `og_uid` int(10) NOT NULL COMMENT '会员id',
  `og_goods_id` int(10) NOT NULL COMMENT '商品id',
  `og_goods_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `og_goods_spec_id` int(10) NULL DEFAULT NULL COMMENT '商品规格id',
  `og_goods_spec_val` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品规格值',
  `og_goods_num` tinyint(3) NOT NULL COMMENT '商品数目',
  `og_goods_price` float(10, 2) NOT NULL COMMENT '商品单价',
  `og_goods_pay_price` float(10, 2) NULL DEFAULT NULL COMMENT '订单支付价格',
  `og_refund_price` float(10, 2) NULL DEFAULT NULL COMMENT '订单退款金额',
  `og_acti_id` int(10) NOT NULL DEFAULT 0 COMMENT '活动id',
  `og_acti` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '活动名称',
  `og_goods_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品图片',
  `og_add_time` int(10) NOT NULL,
  `order_commi_price` float(10, 2) NOT NULL DEFAULT 0.00 COMMENT '订单计算返利的金额',
  `og_supplier_id` int(10) NULL DEFAULT 0 COMMENT '供应商id',
  `og_status` tinyint(1) NULL DEFAULT 0 COMMENT '状态：0未结算1已结算2暂不处理',
  `og_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '暂不处理备注',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '客服售后状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `supplier_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '供应商审核状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `financial_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '财务审核状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `or_goods_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核备注',
  `og_freight` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '运费',
  `or_financial_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '财务审核备注',
  `or_supplier_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '供应商审核备注',
  `back_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '回邮地址',
  `apply_time` int(10) NULL DEFAULT 0 COMMENT '申请时间',
  `audit_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '售后申请单号',
  `audit_issue` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后问题描述',
  `audit_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户凭证',
  `audit_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '换货回邮新地址',
  `audit_reason` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '售后原因',
  `post_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流方式',
  `og_post_status` tinyint(1) NULL DEFAULT 0 COMMENT '物流状态：0，未配货；1，未发货；2，已发货；3，派送中；4，已收货；3，已退货；4，已换货',
  `post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `og_delivery_time` int(10) NULL DEFAULT NULL COMMENT '发货时间',
  `order_return_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退货单号',
  `order_goods_ok_time` int(10) NULL DEFAULT NULL COMMENT '订单完成时间',
  `refund_status` tinyint(1) NULL DEFAULT 0 COMMENT '退款状态：0，未退款；1，已经退款',
  `supplier_post_status` tinyint(1) NULL DEFAULT 0 COMMENT '供应商收货状态：0，未收到货；1，收到货',
  `supplier_post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '供应商换货物流单号',
  `supplier_post_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '供应商换货物流发货方式',
  `post_agin_status` tinyint(1) NULL DEFAULT 1 COMMENT '供应商售后再次发货状态1，未发货；2，已经发货',
  `supplier_post_time` int(10) NULL DEFAULT 0 COMMENT '供应商换货物流时间',
  `after_state_status` tinyint(1) NULL DEFAULT 0 COMMENT '申请售后状态：1，申请退货；2，申请换货 ;3 ,仅退款',
  `audit_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '售后进度状态：0，未提交，1，待审核；2，取消申请；3，已通过；4，售后已收货；5，已完成；6，未通过 7，全部超时,8，退货超时',
  `judge_other` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '登录随机数',
  `og_order_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单状态：\r\n\r\n0，待付款；1，待发货；2，待收货；3，待评价；4，已完成；5，已取消；6，申\r\n\r\n请退货；7，申请换货 8，卖家收货；9，卖家退款 10:售后完成',
  `client_post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户发货单号',
  `client_post_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户发货方式',
  `client_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0未收到货；1用户收到换货',
  PRIMARY KEY (`og_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单商品表' ROW_FORMAT = Compact;

