  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` char(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '活动标题',
  `type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1:满减活动 2：包邮 3：折扣4：积分奖励',
