-- ----------------------------
-- Table structure for ht_rc_log
-- ----------------------------
DROP TABLE IF EXISTS `ht_rc_log`;
CREATE TABLE `ht_rc_log`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `uid` int(11) UNSIGNED NOT NULL COMMENT '用户ID',
