DROP TABLE IF EXISTS `ht_sh_info`;
CREATE TABLE `ht_sh_info`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `og_id` int(11) NOT NULL DEFAULT 0 COMMENT '订单商品表id',
  `og_order_id` int(10) NOT NULL COMMENT '订单id',
