  `og_supplier_id` int(10) NULL DEFAULT 0 COMMENT '供应商id',
  `og_status` tinyint(1) NULL DEFAULT 0 COMMENT '状态：0未结算1已结算2暂不处理',
  `og_remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '暂不处理备注',
  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '客服售后状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `supplier_status` tinyint(1) NOT NULL DEFAULT 2 COMMENT '供应商审核状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `financial_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '财务审核状态：0,正常 1,是未审核 2,审核通过 3,审核未通过',
  `or_goods_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '审核备注',
  `og_freight` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '运费',
  `or_financial_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '财务审核备注',
  `or_supplier_note` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '供应商审核备注',
  `back_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '回邮地址',
  `apply_time` int(10) NULL DEFAULT 0 COMMENT '申请时间',
  `audit_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '售后申请单号',
  `audit_issue` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '售后问题描述',
  `audit_thumb` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户凭证',
  `audit_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '换货回邮新地址',
  `audit_reason` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '售后原因',
  `post_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流方式',
  `og_post_status` tinyint(1) NULL DEFAULT 0 COMMENT '物流状态：0，未配货；1，未发货；2，已发货；3，派送中；4，已收货；3，已退货；4，已换货',
  `post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '物流单号',
  `og_delivery_time` int(10) NULL DEFAULT NULL COMMENT '发货时间',
  `order_return_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退货单号',
  `order_goods_ok_time` int(10) NULL DEFAULT NULL COMMENT '订单完成时间',
  `refund_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '退款状态：0，未退款；1，已经退款',
  `supplier_post_status` tinyint(1) NULL DEFAULT 0 COMMENT '供应商收货状态：0，未收到货；1，收到货',
  `supplier_post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '供应商换货物流单号',
  `supplier_post_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '供应商换货物流发货方式',
  `post_agin_status` tinyint(1) NULL DEFAULT 1 COMMENT '供应商售后再次发货状态1，未发货；2，已经发货',
  `supplier_post_time` int(10) NOT NULL DEFAULT 0 COMMENT '供应商换货物流时间',
  `after_state_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '申请售后状态：1，申请退货；2，申请换货 ;3 ,仅退款',
  `audit_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '售后进度状态：0，未提交，1，待审核；2，取消申请；3，已通过；4，售后已收货；5，已完成；6，未通过 7，全部超时,8，退货超时,',
  `judge_other` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '登录随机数',
  `og_order_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '订单状态：0，待付款；1，待发货；2，待收货；3，待评价；4，已完成；5，已取消；6，申请退货；7，申请换货 8，卖家收货；9，卖家退款 10:售后完成',
  `client_post_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户发货单号',
  `client_post_type` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '客户发货方式',
  `client_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '0未收到货；1收到换货',
  `examine_time` int(10) NOT NULL COMMENT '审核时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单商品表' ROW_FORMAT = Compact;

