INSERT INTO `ht_content` VALUES (2, '用户协议', '', 1, 15, '注册协议', '发布注册协议', '<p>“胡乱购”平台通过以下条款为您提供服务。您应当阅读并遵守《用户注册和隐私保护服务协议》（以下简称为“本协议”），本协议是您与“胡乱购”之间的法律协议。您在使用“胡乱购”提供的各项服务之前，请您务必审慎阅读、充分理解各条款内容，特别是隐私保护、用户信息、免责以及争议管辖与法律适用的条款。 除非您已阅读并接受本协议所有条款，否则您无权使用“胡乱购”提供的服务。您使用“胡乱购”的服务即视为您已阅读并同意本协议的约束，包括“胡乱购”对本协议服务条款随时做的任何修改。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>一、服务说明</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>“胡乱购”的具体服务内容由“胡乱购”根据实际情况提供，如照片上传功能、私信功能、在线投票、在线参加活动等。“胡乱购”保留变更、中断或终止部分网络服务的权利。 “胡乱购”保留根据实际情况随时调整“胡乱购”平台提供的服务种类、形式的权利。“胡乱购”不承担因业务调整给用户造成的损失。“胡乱购”仅提供相关服务，除此之外与本服务有关的设备（如电脑、调制解调器及其他与接入互联网有关的装置）及所需的费用（如为接入互联网而支付的电话费及上网费）均应由用户自行负担。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>二、隐私保护</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>1.用户在注册账号或使用本服务的过程中，可能需要填写或提交一些必要的信息，如法律法规、规章规范性文件（以下称“法律法规”）规定的需要填写的身份信息。如用户提交的信息不完整或不符合法律法规的规定，则用户可能无法使用本服务或在使用本服务的过程中受到限制。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>2.个人隐私信息是指涉及用户个人身份或个人隐私的信息，比如，用户真实姓名、身份证号、手机号码、手机设备识别码、IP地址、用户聊天记录。非个人隐私信息是指用户对本服务的操作状态以及使用习惯等明确且客观反映在胡乱购服务器端的基本记录信息、个人隐私信息范围外的其它普通信息，以及用户同意公开的上述隐私信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>3.尊重用户个人隐私信息的私有性是胡乱购的一贯制度，胡乱购将采取技术措施和其他必要措施，确保用户个人隐私信息安全，防止在本服务中收集的用户个人隐私信息泄露、毁损或丢失。在发生前述情形或者胡乱购发现存在发生前述情形的可能时，将及时采取补救措施。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>4.胡乱购未经用户同意不向任何第三方公开、透露用户个人隐私信息。但以下特定情形除外：</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (1) 胡乱购根据法律法规规定或有权机关的指示提供用户的个人隐私信息；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (2) 由于用户将其用户密码告知他人或与他人共享注册帐户与密码，由此导致的任何个人信息的泄漏，或其他非因胡乱购原因导致的个人隐私信息的泄露；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (3) 用户自行选择向第三方公开其个人信息；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (4) 用户与胡乱购及合作单位之间就用户个人信息的使用公开达成约定，胡乱购因此向合作单位公开用户个人隐私信息；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (5) 任何由于黑客攻击、电脑病毒侵入及其他不可抗力事件导致用户个人隐私信息的泄露；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (6)本协议约定的其他情形等。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>5. 用户同意胡乱购可在以下事项中使用用户的个人信息：</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (1) 胡乱购向用户及时发送重要通知，如软件更新、本协议条款的变更；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (2) 胡乱购内部进行审计、数据分析和研究等，以改进胡乱购的产品、服务和与用户之间的沟通；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (3) 依本协议约定，用户公开其个人信息、胡乱购管理、审查用户信息及进行处理措施；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   (4) 适用法律法规规定的其他事项。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>除上述事项外，如未取得用户同意，胡乱购不会将用户个人隐私信息使用于任何其他用途。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>6.为了改善胡乱购的技术和服务，向用户提供更好的服务体验，胡乱购或可会自行收集使用或向第三方提供用户的非个人隐私信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>三、用户信息收集</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>胡乱购提供服务时，可能会收集、储存和使用下列与您有关的信息。如果您不提供相关信息，可能无法注册成为胡乱购的用户或无法享受胡乱购提供的某些服务，或者无法达到相关服务拟达到的效果。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>1.您向胡乱购提供的信息</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>当您注册胡乱购账户时填写及/或使用胡乱购提供的服务时提交的信息，包括但不限于您的电话号码、用户名信息、简历信息及房源信息等信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>2.在您使用服务过程中收集的信息</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>为了提供并优化您需要的服务，胡乱购会收集您使用服务的相关信息，这类信息包括：</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（1）在您使用胡乱购平台服务，或访问平台网页时，胡乱购自动接收并记录的您的浏览器和计算机上的信息，包括但不限于您的IP地址、实际所在位置的信息、浏览器的类型、使用的语言、访问日期和时间、软硬件特征信息及您需求的网页记录等数据；如您下载或使用胡乱购或其关联公司客户端软件，或访问移动网页使用胡乱购平台服务时，胡乱购可能会读取与您位置和移动设备相关的信息，包括但不限于设备型号、设备识别码、操作系统、分辨率、电信运营商等。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（2）在使用胡乱购平台服务，或访问胡乱购平台网页时，请您不要主动向胡乱购提供您的个人敏感信息（如种族、宗教、政治立场、个人健康和医疗信息、性取向等），否则胡乱购不保证被意外收集的可能性。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（3）在您使用胡乱购平台提供的专项服务时，胡乱购会依据专项服务的要求收集您的其他必要信息。胡乱购将严格按照法律法规的要求进行信息的收集。您应确保您填写或提交的身份信息的真实性，否则胡乱购可选择拒绝为您提供相关的服务。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（4）除上述信息外，胡乱购还可能为了提供服务及改进服务质量的合理需要而收集您的其他信息，包括您与胡乱购的客户服务团队联系时所提供的相关信息，您参与问卷调查时向胡乱购发送的问卷答复信息，以及您与胡乱购的关联方、胡乱购合作伙伴之间互动时胡乱购收集的相关信息。与此同时，为提高您使用胡乱购平台提供的服务的安全性，更准确地预防钓鱼网站欺诈和木马病毒，胡乱购可能会通过了解一些您的网络使用习惯、您常用的软件信息等手段来判断您账户的风险，并可能会记录一些胡乱购认为有风险的URL。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>3.来自第三方的信息</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>为了给您提供更好、更优、更加个性化的服务，或共同为您提供服务，或为了预防互联网欺诈的目的，胡乱购的关联方、合作伙伴会依据法律的规定或与您的约定或征得您同意的前提下，向胡乱购分享您的个人信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   您了解并同意，以下信息不适用本隐私保护条款：</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（1）您在使用胡乱购平台提供的站内搜索服务时输入的关键字信息；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（2）在您未选择“匿名评价”功能时，胡乱购收集到的您在胡乱购平台进行评价的有关数据，包括但不限于用户名、商品名称及评价详情等；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（3）信用评价、违反法律规定或违反胡乱购规则行为及胡乱购已对您采取的措施；</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>（4）应法律法规要求需公示的企业名称等相关工商注册信息以及自然人经营者的信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   您知悉并认可：胡乱购可能会与第三方合作向用户提供相关的网络服务，在此情况下，如胡乱购旗下相应主体已与该第三方签署了适当的保密条款，则胡乱购有权将用户的注册信息等资料提供给该第三方，并要求该第三方按照胡乱购的隐私保护条款以及其他任何相关的保密和安全措施来为胡乱购处理上述信息。另外，在不透露单个用户隐私资料的前提下，胡乱购有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。胡乱购可能会对网络服务使用情况进行统计。同时，胡乱购可能会与公众分享这些统计信息，以展示胡乱购服务的整体使用趋势。这些统计信息不包含您的任何身份识别信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>四、信息使用的目的和方式</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>因收集您的信息是为了向您提供服务及提升服务质量的目的，为了实现这一目的，胡乱购会把您的信息用于下列用途：</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>1.向您提供您使用的各项服务，并维护、改进这些服务。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>2.胡乱购可能使用您提供的个人信息中的联系方式与您通信，例如通知您有关您的账户、安全性更新、产品和服务信息。 为了更好的为您提供服务，请您及时查看胡乱购发送的相关信息。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>3.向您推荐您可能感兴趣的内容，包括但不限于通过系统向您展示个性化的第三方推广信息，或者根据本条款与胡乱购的合作伙伴共享信息以便他们向您发送有关其产品和服务的信息。如果您对胡乱购推荐的内容不感兴趣，请及时回复取消内容的通知。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>4.胡乱购可能使用您的个人信息以预防、发现、调查欺诈、危害安全、非法或违反与胡乱购或其关联方协议、政策或规则的行为，以保护您、其他胡乱购用户，或胡乱购或其关联方的合法权益。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>5.胡乱购可能会将来自某项服务的个人信息与来自其他服务的信息结合起来，用于为了给您提供更加个性化的服务使用，例如让您拥有更广泛的社交圈的需要而使用、共享或披露。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>6.胡乱购不会向任何无关第三方提供、出售、出租、分享或交易您的个人信息，除非事先得到您的同意，或该第三方和胡乱购及其关联方单独或共同为您提供服务，且在该服务结束后，其将被禁止访问包括其以前能够访问的所有这些资料。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>7.如果您向胡乱购提交了您的简历信息，您同意使用胡乱购平台上相应服务的招聘企业或人员可以通过胡乱购的简历数据库找到您的简历。当您在胡乱购填写或提交您的简历信息，并公开您的简历时，您已经同意向使用胡乱购平台上相应服务的招聘企业或人员拥有法律上许可的对您的简历进行查询、使用、问询的权利。对于因此而引起的任何法律纠纷（包括但不限于招聘企业或人员错误或非法使用前述简历信息），胡乱购不承担任何法律责任。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">				</span>尽管胡乱购已经作了相应的安全防范措施，仍可能不可避免某一第三方躲过了胡乱购的安全措施并进入胡乱购的数据库查找到您的简历。胡乱购认为在您把您的简历放入胡乱购的数据库时，您已经意识到并同意承担这样的风险。对于因此而引起的任何法律纠纷，胡乱购不承担任何法律责任。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">			</span>   您知悉并认可：胡乱购通过广告或其他方式向您提供链接，使您可以接入第三方服务或网站。您使用该等第三方的服务时，须受该第三方的服务条款及隐私条款约束，您需要仔细阅读其条款。本协议仅适用于胡乱购提供的服务器所收集的信息，并不适用于任何第三方提供的服务或第三方的信息使用规则，胡乱购对任何第三方使用由您提供的信息不承担任何责任。</p><p><br><