息网络正常的设备维护，信息网络连接故障，电脑、通讯或其他系统的故障，电力故障，罢工，劳动争议，暴乱，起义，骚乱，生产力或生产资料不足，火灾，洪水，风暴，爆炸，战争，政府行为，司法行政机关的命令或第三方的不作为而造成的不能服务或延迟服务。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>4. 您应当严格遵守本协议及胡乱购发布的其他协议、活动规则、站内公告等，因您违反协议或规则的行为给第三方或胡乱购造成损失的，您应当承担全部责任。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>十二、附则</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>本用户条款的订立、执行和解释及争议的解决均应适用中华人民共和国法律。 如用户就本协议内容或其执行发生任何争议，用户应尽量与胡乱购友好协商解决；协商不成时，任何一方均可向“胡乱购”所在地的人民法院提起诉讼。胡乱购未行使或执行本服务协议任何权利或规定，不构成对前述权利或权利之放弃。如本协议条款中的任何条款无论因何种原因完全或部分无效或不具有执行力，本协议条款的其余条款仍应有效并且有约束力。</p><p><br></p><p><br></p><p><br></p><p><span style=\"white-space:pre\">		</span>本协议所有条款的最终解释权属于“胡乱购”。</p>', 1560992900, 1573309016, 0, 'normal', '');
INSERT INTO `ht_content` VALUES (3, '购买需知', '', 1, 15, '购买须知', '商品购买须知', '<p><span style=\"color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\">所有问题，请务必在商品成交之前询问清楚。</span><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\">收到商品的顾客，请于快递派送员面前当面拆开，清点商品，若有损坏，请拒签，若签收过后再因配送过程中造成货品破损本店无法负责。</span><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\">请在网上成交后5个工作日内完成网下交易；出价不买，一律警告+差评+投诉；</span><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\">我们不赞成用放大镜看美女，用显微镜看商品，若您是十足的完美主义者或有专柜情结的买家，请您绕行，手下留情别拍，谢谢了，建议您还是到实体店进行挑选购买，很抱歉。</span><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><br style=\"content: \"\"; display: block; width: 705px; height: 0px; margin: 20px 0px; color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"PingFang SC\", \"Lantinghei SC\", \"Microsoft YaHei\", arial, 宋体, sans-serif, tahoma; font-size: 16px;\">我们珍惜每一个评价，如果您对收到的商品不满意或有异议，请高抬贵手，在评价前请先和本店联系沟通一下，本店一定耐心积极为您解决，不要因为一时意气用事作出冲动的中/差评，谢谢！</span><br></p>', 1560994811, 1573309024, 0, 'normal', '');
INSERT INTO `ht_content` VALUES (4, '拼团规则', '', 1, 15, '拼团', '拼团规则描述', '<div class=\"gz-words\" style=\"padding: 0px; margin: 0px 0px 4rem;\"><p class=\"gz-bt\" style=\"padding: 0px; margin-bottom: 0px;\"><font color=\"#747474\" face=\"Microsoft YaHei, Arial\"><span style=\"font-size: 16px;\"><b>　</b>一、拼团有效期拼团有效期是自开团时刻起的24小时内，如果距离活动结束时间小于24小时，则以活动结束时间为准。</span></font><span style=\"font-size: 16px; color: rgb(116, 116, 116); font-family: \"Microsoft YaHei\", Arial;\">　</span></p><p class=\"gz-bt\" style=\"padding: 0px; margin-bottom: 0px;\"><font color=\"#747474\" face=\"Microsoft YaHei, Arial\"><span style=\"font-size: 16px;\">二、拼团成功拼团有效期内，支付的用户达到参团人数，则拼团成功</span></font></p><p class=\"gz-bt\" style=\"padding: 0px; margin-bottom: 0px;\"><font color=\"#747474\" face=\"Microsoft YaHei, Arial\"><span style=\"font-size: 16px;\">三、拼团失败拼团有效期后，未达成相应参团人数的团，则该团失败；团人数有限，高峰期同时支付人数过多时，以接受第三方支付信息时间先后为准，超过该团人数限制的部分则会拼团失败</span></font></p><p class=\"gz-bt\" style=\"padding: 0px; margin-bottom: 0px;\"><font color=\"#747474\" face=\"Microsoft YaHei, Arial\"><span style=\"font-size: 16px;\">四、等待拼团如何退款？</span></font></p><p class=\"gz-bt\" style=\"padding: 0px; margin-bottom: 0px;\"><span style=\"font-size: 16px; color: rgb(116, 116, 116); font-family: \"Microsoft YaHei\", Arial;\">　　拼团中状态暂不支持退款申请，若拼团失败后会自动退回</span><br></p></div><div class=\"gz-words\" style=\"padding: 0px; margin: 0px 0px 4rem; font-family: \"Microsoft YaHei\", Arial; font-size: 10px;\"></div>', 1560995051, 1564994440, 0, 'normal', '');
