INSERT INTO `ht_content` VALUES (14, '白色垃圾能换钱，垃圾分类回收，胡乱购回收行动开始啦！', NULL, 1, 16, '爱护环境，人人有责', '人人献出一分力，胡乱购助力垃圾回收', '<p class=\"MsoNormal\" style=\"margin: 0pt 0pt 0.0001pt; text-align: justify; font-family: Calibri; font-size: 10.5pt; text-indent: 30pt;\"><span style=\"font-size: 15pt;\"><font face=\"宋体\">响应国家号召，积极配合政府相应的政策，献出我们的微薄之力，让周围环境更加美好</font></span><span style=\"font-size: 15pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 0pt 0.0001pt; text-align: justify; font-family: Calibri; font-size: 10.5pt;\"><span style=\"font-size: 15pt;\"><font face=\"宋体\">爱护我们赖以生存的环境，从点滴做起，养成垃圾分类好习惯！</font></span><span style=\"font-family: 宋体; font-size: 15pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 0pt 0.0001pt; font-family: Calibri; font-size: 10.5pt;\"><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><font face=\"Microsoft Yahei\">据不完全统计</font>, 目前国内废弃塑料已达约1500万</span><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><font face=\"Microsoft Yahei\">吨</font></span><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\">, 且塑料制品废弃物总量仍在持续增长。</span><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><font face=\"Microsoft Yahei\">爱护周边环境，人人有责！</font></span><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin: 0pt 0pt 0.0001pt; font-family: Calibri; font-size: 10.5pt;\"><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><font face=\"Microsoft Yahei\">活动细则：</font></span><span style=\"font-family: &quot;Microsoft Yahei&quot;; letter-spacing: 0pt; font-size: 16pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:Calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'Times New Roman\';font-size:15.0000pt;mso-font-kerning:1.0000pt;\">A.</span><!--[endif]--><span style=\"font-family: Calibri; font-size: 15pt;\"><font face=\"宋体\">矿泉水瓶（</font>550ML<font face=\"宋体\">为标准）</font><font face=\"Calibri\">X10=0.3</font><font face=\"宋体\">元平台内现金代金券</font></span><span style=\"font-family: Calibri; font-size: 15pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:Calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'Times New Roman\';font-size:15.0000pt;mso-font-kerning:1.0000pt;\">B.</span><!--[endif]--><span style=\"font-family: Calibri; font-size: 15pt;\"><font face=\"宋体\">易拉罐</font>X10=0.8<font face=\"宋体\">元平台内现金代金券</font></span><span style=\"font-family: Calibri; font-size: 15pt;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><!--[if !supportLists]--><span style=\"font-family:Calibri;mso-fareast-font-family:宋体;mso-bidi-font-family:\'Times New Roman\';font-size:15.0000pt;mso-font-kerning:1.0000pt;\">C.</span><!--[endif]--><span style=\"font-family: Calibri; font-size: 15pt;\"><font face=\"宋体\">废旧报纸</font>·<font face=\"宋体\">书籍 &nbsp;</font><font face=\"Calibri\">1</font><font face=\"宋体\">斤</font><font face=\"Calibri\">=0.2</font><font face=\"宋体\">元平台内现金代金券</font></span></p><p class=\"MsoNormal\"><span style=\"font-family: Calibri; font-size: 15pt;\"><font face=\"宋体\"><br></font></span><span style=\"font-family: Calibri; font-size: 15pt;\"><o:p></o:p></span></p>', 1571902159, 1571902159, 0, 'normal', 'http://hangma.hncjne.com/uploads/20191024/79c01e957c2469a5aab1568de8c12cd9.jpeg');
INSERT INTO `ht_content` VALUES (15, '会员卡介绍', NULL, 1, 15, '', '', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: Menlo, monospace; font-size: 11px; white-space: pre-wrap;\">会员资格以月为单位计算，会员服务费用标准为19.9元/月，用户应通过一次性支付的方式购买会员服务。胡乱购将根据不同的购买方式和数量，向用户提供不同幅度的优惠，具体优惠信息以会员购买支付页上内容为准。\r\n   胡乱购可以根据实际情况随时调整会员服务费用标准，经调整的会员服务费用标准将在会员资格支付页上显示，用户按调整后的服务费用标准支付后方可享有或延续会员资格。已按原会员服务费用标准购买会员服务的用户，其会员资格以及所享有的会员服务在已取得的会员资格期限内不受影响，无需补充缴纳差额。 </span></p>', 1574217565, 1574228028, 0, 'normal', '');
