INSERT INTO `ht_goods_category` VALUES (179, '白坯家具', 0, 1, '白坯', '丰富齐全的白坯家具，种类丰富，风格多样，品质保证，用户可以一站式选购，非常便捷。', 0, 'http://api.taixingxinyijiaju.com/uploads/20200731/aa8365ff5d472b05c7aa077f8b0f2ce5.png', 'normal', 2);
INSERT INTO `ht_goods_category` VALUES (180, '成品家具', 0, 1, '成品', '欧式家具是欧式风格装修的重要元素，以意大利、法国和西班牙风格的家具为主要代表。讲究手工精细的裁切雕刻。轮廓和转折部分由对称而富有节奏感的曲线或曲面构成，并装饰镀金铜饰、真皮等，结构简练，线条流畅，色彩富丽，艺术感强，给人的整体感觉是华贵优雅，十分庄重。', 0, 'http://api.taixingxinyijiaju.com/uploads/20200801/973071f217f7300b287148cbb7abfa9d.jpg', 'normal', 2);
INSERT INTO `ht_goods_category` VALUES (181, '整屋定制', 0, 1, '整屋定制', '实现家居风格的统一，从设计、选材与规格、色彩，到功能、环保与配套升级，每一件家居产品都单独定制，但却都是全屋定制体系的构成单元。每个空间都有多种风格主题实现个性的需要。', 0, 'http://api.taixingxinyijiaju.com/uploads/20200801/dfd0277930bc97d8ac18eecc54feae8a.jpg', 'normal', 2);
